package com.jivosite.sdk.model.pojo.configimport com.jivosite.sdk.model.pojo.rate.RateSettingsimport com.jivosite.sdk.model.pojo.response.Responseimport com.squareup.moshi.Jsonimport com.squareup.moshi.JsonClass/** * Created on 4/28/21. * * @author Alexander Tavtorkin (tavtorkin@jivosite.com) */@JsonClass(generateAdapter = true)data class Config(    @Json(name = "site_id")    val siteId: String,    @Json(name = "chatserver_host")    val chatserverHost: String,    @Json(name = "api_host")    val apiHost: String,    @Json(name = "files_host")    val filesHost: String,    @Json(name = "license")    val license: Boolean? = null,    @Json(name = "show_rate_form")    val showRateForm: Int? = null,    @Json(name = "rate_settings")    val rateSettings: RateSettings? = null) : Response()